import React, { useEffect, useState } from 'react';

const Mantenciones = () => {
  const [mantenciones, setMantenciones] = useState([]);
  const [filtroFecha, setFiltroFecha] = useState('');
  const [formData, setFormData] = useState({
    fecha: '',
    descripcion: '',
    vehiculoPatente: '',
    kilometraje: '',
    proveedor: '',
    costo: '',
  });

  const fetchMantenciones = () => {
    fetch('http://localhost:8000/mantenciones')
      .then(res => res.json())
      .then(data => setMantenciones(data))
      .catch(err => console.error('Error cargando mantenciones:', err));
  };

  useEffect(() => {
    fetchMantenciones();
  }, []);

  const handleInputChange = e => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const validarFormulario = async () => {
    const { fecha, descripcion, vehiculoPatente, kilometraje, proveedor, costo } = formData;

    if (!fecha || !descripcion || !vehiculoPatente || !kilometraje || !proveedor || !costo) {
      alert('Todos los campos son obligatorios');
      return false;
    }

    const fechaIngresada = new Date(fecha);
    const hoy = new Date();
    if (fechaIngresada > hoy) {
      alert('La fecha no puede ser futura');
      return false;
    }

    // Verificar 칰ltimo kilometraje registrado del veh칤culo
    const mantencionesVehiculo = mantenciones.filter(m => m.vehiculoPatente === vehiculoPatente);
    const maxKm = Math.max(0, ...mantencionesVehiculo.map(m => parseInt(m.kilometraje || 0)));

    if (parseInt(kilometraje) < maxKm) {
      alert(`El kilometraje debe ser mayor o igual a ${maxKm}`);
      return false;
    }

    return window.confirm('쮼st치s seguro de guardar esta mantenci칩n?');
  };

  const handleSubmit = async e => {
    e.preventDefault();
    if (!(await validarFormulario())) return;

    fetch('http://localhost:8000/mantenciones', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(formData),
    })
      .then(res => res.json())
      .then(() => {
        alert('Mantenci칩n registrada correctamente');
        setFormData({
          fecha: '',
          descripcion: '',
          vehiculoPatente: '',
          kilometraje: '',
          proveedor: '',
          costo: '',
        });
        fetchMantenciones();
      })
      .catch(err => console.error('Error al registrar:', err));
  };

  const mantencionesFiltradas = filtroFecha
    ? mantenciones.filter(m => m.fecha.startsWith(filtroFecha))
    : mantenciones;

  return (
    <div className="p-6 w-full max-w-4xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">游 Mantenciones</h2>

      {/* 游댌 Filtro por fecha */}
      <div className="mb-4">
        <label className="block mb-1">Buscar por fecha:</label>
        <input
          type="date"
          value={filtroFecha}
          onChange={e => setFiltroFecha(e.target.value)}
          className="border p-2 rounded w-full"
        />
      </div>

      {/* 游늶 Formulario de registro */}
      <form onSubmit={handleSubmit} className="bg-gray-100 p-4 rounded shadow mb-6 space-y-2">
        <h3 className="text-lg font-semibold mb-2">Registrar nueva mantenci칩n</h3>
        {[
          { name: 'fecha', type: 'date' },
          { name: 'descripcion', type: 'text' },
          { name: 'vehiculoPatente', type: 'text' },
          { name: 'kilometraje', type: 'number' },
          { name: 'proveedor', type: 'text' },
          { name: 'costo', type: 'number' },
        ].map(({ name, type }) => (
          <div key={name}>
            <label className="capitalize block">{name}:</label>
            <input
              type={type}
              name={name}
              value={formData[name]}
              onChange={handleInputChange}
              className="border p-2 rounded w-full"
              required
            />
          </div>
        ))}

        <button
          type="submit"
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
        >
          Registrar
        </button>
      </form>

      {/* 游닇 Lista de mantenciones */}
      {mantencionesFiltradas.length === 0 ? (
        <p>No hay mantenciones registradas.</p>
      ) : (
        <ul className="space-y-2">
          {mantencionesFiltradas.map(m => (
            <li key={m.id} className="bg-white p-4 rounded shadow">
              <strong>{m.vehiculoPatente}</strong> - {m.tipoMantencion} - {m.fecha}
              <br />
              Km: {m.kilometraje} | Proveedor: {m.proveedor} | Costo: ${m.costo}
              <br />
              <em>{m.descripcion}</em>
              {/* Aqu칤 agregar칤as bot칩n "Editar" */}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Mantenciones;
